import React from 'react';
import { Text } from 'react-native';
import { StyleSheet, View, Button, Pressable} from 'react-native';
import { useState } from 'react';
import {withNavigation} from "react-navigation";
import DiversityBar from './DiversityBar';

const Selection = () => {


    const [data, setData] = useState(null);
    const progress = 0.78;
    const [select, setSelect] = useState(0);



  return (
    <>
    <DiversityBar progress={progress}></DiversityBar>

        <Text>You are on FourthPage</Text>
        {(select == 0) ? <><Pressable style={styles.button} onPress={() => setSelect(1)}><Text style={styles.buttonText}>Big Tech</Text></Pressable>
        <Pressable style={styles.button}><Text style={styles.buttonText}>Energy</Text></Pressable>
        <Pressable style={styles.button}><Text style={styles.buttonText}>Finance</Text></Pressable>
        <Pressable style={styles.button}><Text style={styles.buttonText}>Consumer Staples</Text></Pressable>
        <Pressable style={styles.button}><Text style={styles.buttonText}>Communication</Text></Pressable>
        <Pressable style={styles.button}><Text style={styles.buttonText}>Vehicles</Text></Pressable></> : <></>}

        {(select == 1) ? <>

            <Pressable style={styles.button}><Text style={styles.buttonText}>Microsoft</Text></Pressable>
            <Pressable style={styles.button}><Text style={styles.buttonText}>Apple</Text></Pressable>
            <Pressable style={styles.button}><Text style={styles.buttonText}>Google</Text></Pressable>
            <Pressable style={styles.button}><Text style={styles.buttonText}>Meta</Text></Pressable>
            <Pressable style={styles.button}><Text style={styles.buttonText}>Snapchat</Text></Pressable>

            <Pressable style={styles.button2} onPress={() => setSelect(0)}><Text style={styles.buttonText}>BACK</Text></Pressable>

        </> : <></>}

    </>
  );



}

const styles = StyleSheet.create({

    container: {
      flex: 1,
      backgroundColor: '#1c0b24',
      alignItems: 'center',
      justifyContent: 'center',
    },
    header: {
      fontSize: 30,
      color: 'white',
      marginBottom: 20,
      fontWeight: 800,
    },
    button: {
        alignItems: 'center',
        width: 300,
        justifyContent: 'center',
        paddingVertical: 12,
        marginTop: 15,
        paddingHorizontal: 32,
        borderRadius: 4,
        elevation: 3,
        backgroundColor: '#d90f8e',
      },
      button2: {
        alignItems: 'center',
        width: 300,
        justifyContent: 'center',
        paddingVertical: 12,
        marginTop: 15,
        paddingHorizontal: 32,
        borderRadius: 4,
        elevation: 3,
        backgroundColor: 'gray',
      },
    buttonText: {
        fontSize: 20,
        textAlign: 'center',
    },
    text1: {
      fontSize: 15,
    },
  });

export default Selection;
